import React from 'react';
import { generatePhotoLocationMap } from '../utilities/shared';
import Card from './Card';
import './Memory.css';

function Memory() {
  const arr = generatePhotoLocationMap();

  return <div className='card-container'>
    {
      arr.map((el,i) => <Card key={`${el}-${i}`} photo={el} index={i} />)
    }
  </div>;
}

export default Memory;
